import React from "react";
import ColorLogo from "../../Assets/Color logo.png";
import WhiteLogo from "../../Assets/White logo.png";

const SignUp = () => {
  return (
    <div className="d-flex justify-content-center">
      <div
        className="row px-0 w-100 align-items-center"
        style={{ height: "100vh", backgroundColor: "red" }}
      >
        <div
          className="d-flex h-100 align-items-center justify-content-center  mx-0 row col-lg-6 col-md-12 col-sm-12"
          style={{ backgroundColor: "rgb(22,135,167,0.49)" }}
        >
          <div className="w-75">
            <img alt="" src={ColorLogo} width="100%" className="" />
          </div>
          <div className="row text-center">
            <h5>
              Track your expenses<br></br>Improve your finances
            </h5>
          </div>
        </div>
        <div
          className="mx-0 row col-lg-6 col-md-12 col-sm-12"
          style={{ backgroundColor: "#1687A7", opacity: "5%" }}
        >
          SignUp
        </div>
      </div>
    </div>
  );
};

export default SignUp;
